sql_command:
SELECT COUNT(DISTINCT t.transaction_id) AS total_transactions
FROM banking_new."Transactions" t
JOIN banking_new."Cards" c ON t.account_id = c.customer_id;

SELECT customer_id, COUNT(*) AS account_count
FROM banking_new."Accounts"
GROUP BY customer_id;

SELECT customer_id, COUNT(*) AS loan_count
FROM banking_new."Loans"
GROUP BY customer_id;

SELECT COUNT(DISTINCT "Customers".customer_id) AS unique_customer_count
FROM "banking_new"."Customers"
JOIN "banking_new"."Deposits" ON "Customers".customer_id = "Deposits".customer_id;

SELECT COUNT(DISTINCT "Customers".customer_id) AS unique_customers_with_cards
FROM "banking_new"."Customers"
JOIN "banking_new"."Cards" ON "Customers".customer_id = "Cards".customer_id;

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE transaction_amount > (SELECT AVG(transaction_amount) FROM banking_new."Transactions");

SELECT COUNT(*) AS deposit_count
FROM banking_new."Deposits"
WHERE balance > (SELECT AVG(balance) FROM banking_new."Deposits");

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE balance > (SELECT AVG(balance) FROM banking_new."Loans");

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE interest_rate > (SELECT AVG(interest_rate) FROM banking_new."Loans");

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE transaction_amount BETWEEN 100 AND 1000;

SELECT COUNT(*) AS deposit_count
FROM banking_new."Deposits"
WHERE start_date > '2024-01-01';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE end_date < '2026-01-01';

SELECT COUNT(*) AS deposit_count
FROM banking_new."Deposits"
WHERE term BETWEEN '6 months' AND '12 months';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE payment_term BETWEEN '12 months' AND '24 months';

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE updated_at >= CURRENT_TIMESTAMP - INTERVAL '7 days';

SELECT COUNT(DISTINCT account_id) AS account_count
